import * as React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';

// import CurrentScreen from '../screen/Current'
// import TrendsScreen from '../screen/Trends'

import CurrentNavigation from './CurrentNavigation'
import TrendsNavigation from './TrendsNavigation'
import CustomDrawer from '../component/CustomDrawer'
const Drawer = createDrawerNavigator();

export default App = props => {
  // console.log(props.topicData)
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Current"
      drawerContent={(props) => <CustomDrawer {...props} />}
      drawerStyle={{
        backgroundColor: '#c6cbef',
      }}>
        <Drawer.Screen name="Current" component={CurrentNavigation} />
        <Drawer.Screen name="Trends" component={TrendsNavigation} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
